import React from 'react';

class Header extends React.Component{
    render() {
        return (

        <React.Fragment>
        <header className="top">
            <h1>Catch of the day</h1>
        </header>
    <h3 class="tagline">
        <span>Fresh Daily</span>
    </h3>
    </React.Fragment>

        )
    }
}
export default Header;
